html {
    margin: 0px;
    padding: 0px;
    background-color: white;
}

.pill-button {
    border: none;
    outline: none;
    display: block;
    cursor: pointer;
    font-weight: 200;
    font-size: 2.2rem;
    padding-left: 3rem;
    padding-right: 3rem;
    margin-bottom: 4rem;
    border-radius: 25px;
    padding-top: 0.8rem;
    padding-bottom: 0.8rem;
    color: cornflowerblue;
    background-color: white;
    transition-duration: 0.2s;
}
.pill-button:hover {
    color: rgb(80, 125, 207);
    background-color: lightgray;
}
.pill-button:active {
    color: rgb(46, 84, 155);
    background-color: rgb(172, 172, 172);
}
